import React, { memo } from 'react'
import { shallowEqual, useSelector } from 'react-redux'

export default memo(function Banner() {
  // 从store中获取数据
  const { banners } = useSelector((state) => ({
    banners: state.Banner
  }), shallowEqual)

  return (
    <div>
      {
        banners.map(item => {
          return (
            <div key={item.imageUrl}>
              {item.imageUrl}
            </div>
          )
        })
      }
    </div>
  )
})
